import React,{Component} from 'react';
import {
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './login';
import './App.css';
import 'tachyons';

class App extends Component {
  constructor(){
    super();
  }
  render(){
      return (
      <div className="App">
        <Switch>
          <Route path="/signin">
            <Login/>
          </Route>
          <Route path="/signup">
            <Login/>
          </Route>
        </Switch>

      </div>
    );
    }
}

export default App;
